from svglib.svglib import svg2rlg
from reportlab.graphics import renderPM
import PySimpleGUI as sg
import re
import requests

# Run this app for CAPTCHA: https://github.com/amazing14/cowin-captcha
# set the below flag to False
USE_GUI = True  #False


def captcha_builder(resp):
    with open('captcha.svg', 'w') as f:
        f.write(re.sub('(<path d=)(.*?)(fill=\"none\"/>)', '', resp['captcha']))

    drawing = svg2rlg('captcha.svg')
    renderPM.drawToFile(drawing, "captcha.png", fmt="PNG")

    captcha_text = ""
    try:
        with open('captcha.svg', 'r') as f2:
            svg_text = f2.read()
            # print("SVG Text received: {}".format(svg_text))
            captcha_text = requests.post("http://127.0.0.1:8000", json={"captcha" : svg_text}).text
            print("Captcha Text received: {}".format(captcha_text))
            if not USE_GUI:
                return captcha_text
    except Exception as e:
        print("Unable to get automatic captcha text.. Please enter manual captcha")

    layout = [[sg.Image('captcha.png')],
              [sg.Text("Enter Captcha Below")],
              [sg.Input(key='inp', default_text=captcha_text)],
              [sg.Button('Submit', bind_return_key=True)]]

    window = sg.Window('Enter Captcha', layout, finalize=True)
    window.TKroot.focus_force()         # focus on window
    window.Element('inp').SetFocus()    # focus on field
    event, values = window.read()
    window.close()
    return values['inp']

